import React from "react";

const Skills = ({ skillsData }) => {
  return (
    <div className="bg-white text-purple-700 p-8 text-center flex w-8/12">
      <h2 className="text-3xl mt-4 font-bold text-custom-blue">{skillsData.titles[0]}</h2>
      <div className="flex flex-col gap-4 mt-4 mr-0">
        {skillsData.skills.map((skill) => (
          <div key={skill.id} className="flex items-center p-4 text-gray-500 text-lg m-0">
            <img src={skill["img-link"]} alt={skill.alt} className="mr-2 w-10 h-10 rounded-full ml-0" />
            <span className="m-0">{skill.alt}</span>
          </div>
        ))}
      </div>

    </div>
  );
};

export default Skills;
